import React from 'react';
import { Page, Text, View, Document, StyleSheet, BlobProvider } from '@react-pdf/renderer';

// Create styles
const newstyles = StyleSheet.create({
  page: {
    flexDirection: 'row',
    backgroundColor: '#bff044'
  },
  section: {
    margin: 10,
    padding: 10,
    flexGrow: 1
  }
});

// Create Document Component
const MyDocument =(
  <Document>
    <Page >
      <View>
        <Text>Este es un texto cualquiera</Text>
      </View>
    </Page>
  </Document>)

const PDF = () => (
  <BlobProvider document={MyDocument}>
    {({ blob, url }) => (
      <a href={blob} target="_blank">Previsualizar</a>
    )}
  </BlobProvider>
);


export default PDF;
